import { useHistory } from 'react-router-dom';

useEffect(() => {
        
    props.dispatch({

        type: "Cart_Items",
        payload:totalamount
    })
 
    setCakelist(props.cartcakeslist);
}, [totalamount])
 function Myorders() {
    const history = useHistory();

    function shopping() {
        history.push("/")
    }
    return(
        <>
        <div className=" bg-light rounded px-5 py-4 mt-5 shadow" style={{ width: "50%", margin: "auto" }}>
            <h3>Your order placed Succsefully</h3>
            <button onClick={shopping} type="submit" className="btn btn-primary mt-3">CONTINUE SHOPPING</button>
        </div>
        </>
    )
    
}
export default connect(function (state, props) {
    return {
        cartcakeslist: state["cartitemslist"]["cartitems"] || [],

    }
})(Myorders)
